import React, { useState } from 'react'

export default function ResetPassword() {
    const [resetcode , setReset] = useState("")
  return (
    <div>
        <form className='d-flex justify-content-center align-items-center' style={{height:"100vh"}}>
            <label htmlFor="resetCode">resetCode</label>
            <input type="number" id='resetCode' placeholder='resetCode' value={resetcode} onChange={(e)=>setReset(e.target.value)} className='form-control'  />
        </form>
    </div>
  )
}
